      SELECT DISTINCT - col0 FROM tab2 (FORMAT parquet) WHERE CAST ( NULL AS INTEGER ) NOT IN ( - col0 * - ( + - col2 ) * 36 + - + 4, - col0 - + 21 );
  - name: tab2

outputs:
  - name: q6991.out
    data: |
